  \"fleet-dna\",\n\t\"isopen\": true,\n\t\"url\": null,\n\t\"notes\": \"Available
  online at www.nrel.gov/fleetdna, the Fleet DNA clearinghouse of commercial fleet
  vehicle operating data helps vehicle manufacturers and developers optimize vehicle
  designs and helps fleet managers choose advanced technologies for their fleets.
  Sponsored by the U.S. Department of Energy, this online tool provides data summaries
  and visualizations similar to real-world genetics for medium- and heavy-duty commercial
  fleet vehicles operating in a variety of vocations.nnHOW TO CITE THE DATAnIf you
  use Fleet DNA data in a publication, please include a citation with the following
  information:  Walkowicz, K.; Kelly, K.; Duran, A.; Burton, E. (2016). Fleet DNA
  Project Data. National Renewable Energy Laboratory. http://www.nrel.gov/fleetdnannIf
  you use Fleet DNA data in a publication, also please notify Adam Duran at adam.duran@nrel.gov
  so we can gauge the reach of the data.nn\",\n\t\"license_title\": \"Creative Commons
